import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import './AdminManager.css';
class AdminManager extends Component {
    render() {
        return (
            <div>
                <div>
                    <Link to="/logout">Logout</Link>
                </div>
            </div>
        );
    }
}

export default AdminManager;
